import React from 'react';
import ReactDOM from 'react-dom';
import add, {sub, mult, div} from './App';
ReactDOM.render(
<>
<h1>Sum of two numbers is : {add(30, 34)}</h1>
<h1>Substraction of two numbers is : {sub(30, 3)}</h1>
<h1>Multiplication of two numbers is : {mult(30, 3)}</h1>
<h1>division of two numbers is : {div(30, 3)}</h1>
{/* <h1>{name1()}</h1>
<h1>{name2()}</h1> */}
</>, 
document.getElementById('root'));
